[u"Software Engineer
JK Moving Services - Sterling, VA
February 2015 to Present
Participate in all aspects of software development life cycle, including application design, implementation and deployment;
• Worked closely with business analysts and solution architects to understand business processes for designing technical solutions;
• Analyze database data and identify integrity issues with existing and proposed systems and implement solutions;
• Responsible for transferring customer and detailed job information to the enterprise core system;
• Refactor current system and application with the latest framework and technologies;

PROJECTS
Real-Time Data Transfer
• Worked with N-Tier Architecture involving service layer, data access layer and business layer;
• Designed and created a new filter algorithm to help avoid duplicate information;
• Created stored procedures, views, functions and triggers in SQL server;
• Used Lambda expressions, LINQ to SQL and LINQ to entities for retrieving and inserting data in database
• Designed and developed procedures for auto-assigning move coordinator based on move types;
• Parsed XML, TXT files and merge data to data source;
• Test components by using unit testing method;
• Wrote and executed SQL queries to verify the data updates to tables and ensure data integrity;
• Worked with team foundation source control as the version control and project management;
Enterprise Core System
• Customized Microsoft Dynamics 365 system entities and customized entities based on business requirement;
• Built and added auto-complete feature by using Google Map API for address look up and correction;
• Developed activity creation plugin which allows generating activities automatically during on save event;
• Enhance system and maintain data integrity by building customized plugins based on CRM native SDK;
• Developed CRM web resources with HTML, CSS and JavaScript for CRM extended web application;
• Applied Model-View-Controller to retrieve and display regarding information on dashboard based on user's role;
• Analyzed customer survey data by using Qualtrics API for reporting purposes;
• Created SSIS packages for data analysis and reporting;
Mileage Calculation
• Analyze and built look up mechanism by using high frequent history records in SQL database;
• Used Google Map API for looking up address by zipcode and correcting addresses if address is not existing;
• Used Milemaker API for calculating mileage based on origin and destination addresses;
• Designed and created database architecture for saving search history;
• Created and Implemented Restful web services;
Enterprise Client Application
• Designed and created dashboard to showing service processes;
• Worked with JSON library to parse JSON FILES;
• Embedded Google Map API, GPS location data into application;
• Worked with QA team with user acceptance testing;"]
